import React from 'react'

class SelectsInputs extends React.Component {
  render(){
    return (
      <div>
         <label for="selectColumn">Filtros</label>
         <select data-testid='comparison-filter' name="Coluna" id="selectColumn" form="selectForm">
         <option value="population">Population</option>
         <option value="orbital_period">Orbital Period</option>
         <option value="diameter">Diameter</option>
         <option value="rotation_period">Rotation Period</option>
         <option value="surface_water">Surface Water</option>
         </select>
         <label for="selectMaior"></label>
         <select name="Maior"form='selectForm'>
           <option value='maiorQ'>Maior que</option>
           <option value='menorQ'>Menor que</option>
         </select>
      </div>
    )
  }
}
export default SelectsInputs;
